import React from 'react';
import './index.css';


const styles = {
    height: '90vh',
    weight: '1000px !important'
}

class Resume extends React.Component {
    render() {
        return(
            <div style={styles} className="resume" id={this.props.id}>
                <h1>Resume</h1>
            </div>
        );
    };
};

export default Resume;
